import React, { Component } from 'react'

export default class Header extends Component {
  render() {
    return (
      <div className='w-full h-20  bg-blue-800 text-white fixed top-0'>
        <div>Home</div>
        <div>About Us</div>
        <div>Contact Us</div>
        <div>Home</div>
      </div>
    )
  }
}
